import React from "react";
import ReactDOM from "react-dom";

const Card = (props) => {
  return (
    <div>
      <div class="grid-item" backgroundImage="url({props.img})">
        <a href="https://www.google.com/" target="blank">
          {/* <img src={props.img} /> */}
        </a>

        <div class="info">
          <h4 class="project-name">{props.title}</h4>
          <h4 class="project-type">{props.type}</h4>
        </div>
      </div>
    </div>
  );
};

export default Card;
